import React,{useState} from 'react';
import Scores from '../game/scores/scores';
import { Link } from "react-router-dom";
function Lobby({user,socket}){
    const [startGame,setStartGame] = useState(false)
    return(
        <div>{
            startGame?
            <div>
                <h2>
                    Startgame is true
                </h2>
            </div>
            :
            <div>
                <h2>
                    Startgame is false
                </h2>
            </div>
        }</div>
    );
}
export default Lobby

